import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Navbar from "components/navbar/Navbar";
import Home from "containers/home/Home";

function App() {
  return (
    <>
      <div>

        {/* <div className=' absolute bottom-2'> */}

        {/* </div> */}
        <BrowserRouter>
          <Navbar />

          <Routes>
            <Route path="/" element={<Home />} />
          </Routes>
        </BrowserRouter>
           <div class="line"></div>
        <div class="spark"></div>
        <div class="line"></div>
        <div class="spark"></div>
        <div class="line"></div>
        <div class="spark"></div>
      </div>
    </>
  );
}

export default App;
